  if n == 0: 
    return 0 
  elif n == 1: 
    return 1
  else: 
    return findFibonacci(n-1) + findFibonacci(n-2)

class Queue: 
    def __init__(self): 
        self.items = [] 
        self.full = False 

    def is_full(self): 
        return self.full 

    def enqueue(self, item): 
        if not self.full: 
            self.items.append(item) 
            self.full = True 
        else: 
            raise FullException("The queue is full") 

    def dequeue(self): 
        if not self.full: 
            return self.items.pop() 
        else: 
            raise FullException("The queue is full") 

    def empty(self): 
        return self.full == False 

class FullException(Exception): 
    pass
